db.payers.aggregate([
  {
    $match: {
      NAME: "Humana"
    }
  },
  {
    $unwind: "$EXPENSES"
  },
  {
    $group: {
      _id: null,
      UNCOVERED_IMMUNIZATIONS: { $sum: "$EXPENSES.INSURANCE_COSTS" },
      COVERED_IMMUNIZATIONS: { $sum: "$EXPENSES.HEALTHCARE_EXPENSES" }
    }
  },
  {
    $project: {
      _id: 0,
      UNCOVERED_IMMUNIZATIONS: 1,
      COVERED_IMMUNIZATIONS: 1
    }
  }
]);

