db.patients.aggregate([
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $match: {
            "CLAIMS.CLAIM_TRANSACTIONS.TYPE": "PAYMENT",
            "CLAIMS.CLAIM_TRANSACTIONS.PAYER_REF": "NO_INSURANCE"
        }
    },
    {
        $group: {
            _id: {
                CLAIM_ID: "$CLAIMS.CLAIM_ID"
            },
            TOTAL_PAID: { $sum: { $toDouble: "$CLAIMS.CLAIM_TRANSACTIONS.AMOUNT" } }
        }
    },
    {
        $unwind: "$CLAIMS.IMMUNIZATIONS"
    },
    {
        $match: {
            "CLAIMS.CLAIM_TRANSACTIONS.CLAIM_ID": {
                $in: [
                    "_id.CLAIM_ID"
                ]
            }
        }
    },
    {
        $group: {
            _id: null,
            TOTAL_IMMUNIZATIONS_PAID: { $sum: 1 }
        }
    },
    {
        $project: {
            _id: 0,
            TOTAL_IMMUNIZATIONS_PAID: {
                $toDouble: "$TOTAL_IMMUNIZATIONS_PAID"
            }
        }
    }
]);

