db.patients.aggregate([
    {
        $match: {"CLAIMS.PAYER_REF": "0133f751-9229-3cfd-815f-b6d4979bdd6a"}
    },
    {
        $unwind: "$CLAIMS"
    },
    {
        $match: {"CLAIMS.PAYER_REF": "0133f751-9229-3cfd-815f-b6d4979bdd6a"}
    },
    {
        $group: {
            _id: null,
            total_encounters: { $sum: 1 },
            covered_encounters: { $sum: { $cond: [ { $eq: [ "$CLAIMS.PAYER_COVERAGE", null ] }, 0, 1 ] } },
            uncovered_encounters: { $sum: { $cond: [ { $eq: [ "$CLAIMS.PAYER_COVERAGE", null ] }, 1, 0 ] } }
        }
    },
    {
        $project: {
            _id: 0,
            total_encounters: 1,
            uncovered_encounters: { $subtract: [ "$total_encounters", "$covered_encounters" ] }
        }
    }
]);

