            START: "$ENCOUNTERS.START",
            STOP: "$ENCOUNTERS.STOP"
        }
    }
])

db.payers.aggregate([{
    $match: {
        "NAME": "Anthem"
    }
}, {
    $lookup: {
        "from": "PATIENTS",
        "pipeline": [{
                $unwind: "$CLAIMS"
            },
            {
                $lookup: {
                    "from": "PROVIDERS",
                    "localField": "CLAIMS.PROVIDER_REF",
                    "foreignField": "PROVIDER_ID",
                    "as": "PROVIDER_INFO"
                }
            },
            {
                $match: {
                    "PROVIDER_INFO.ORGANIZATION_REF": "b10e83a1-cf28-f6a2-1077-c0537c5842be" // Anthem organization id
                }
            },
            {
                $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
            },
            {
                $group: {
                    _id: 0,
                    count: {
                        $sum: 1
                    }
                }
            }
        ],
        "as": "covered_procedures"
    }
}, {
    $project: {
        _id: 0,
        PROCEDURES_COUNT: {
            $cond: {
                if: {
                    $lte: [{
                            $size: "$covered_procedures"
                        },
                        0
                    ]
                },
                then: 0,
                else: "$covered_procedures.count"
            }
        }
    }
}])
